import React from 'react';

function ReleasePokemon(){

};

function MyPokemons(){
    //Get list of caught Pokemons
    var myPokemons = JSON.parse(window.localStorage.getItem("myPokemons"));

    if (myPokemons!=null){ //If list is not empty return list
        return(
            myPokemons.map((mp, index) => (
                <div key={mp.nickname}>
                    <p>Index: {index}</p>
                    <h1>{mp.name}</h1>
                    <img src={mp.image} alt={mp.name}/>
                    <p>Nickname: {mp.nickname}</p>
                    <button>Release Pokemon</button>
                </div>
            ))
        );
    }else{
        return (
            <p>No Pokemons caught yet:(</p>
        );
    }
};

export default MyPokemons;
